import React from 'react';
import './App.css';
import { Navbar } from './layouts/NavbarAndFooter/Navbar';
import { ExploreTopClasses } from './layouts/HomePage/ExploreTopClasses';
import { Carousel } from './layouts/HomePage/Carousel';

function App() {
  return (
    <div>
      <Navbar/>
      <ExploreTopClasses/>
      <Carousel/>
    </div> 
  );
}

export default App;
